import React from "react";

const ShoppingItems = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h2>Eco-Friendly Products</h2>
      <ul>
        <li>Organic Cotton T-shirt - ₹499</li>
        <li>Recycled Denim Jeans - ₹999</li>
        <li>Bamboo Sunglasses - ₹799</li>
        <li>Hemp Tote Bag - ₹299</li>
      </ul>
    </div>
  );
};

export default ShoppingItems;
